import React from 'react';
import { Link } from 'react-router-dom';
import Navigation from './Navigation'

const Billeterie = () => {
    return(
        <Link to ="/">
            <div className="billeterie">
                <button className="billeterie_btn">
                    Billeterie
                </button>
            </div>
        </Link>
    )
}

export default Billeterie;
